import 'svelte/internal/disclose-version';
import * as $ from 'svelte/internal/client';
import { useStoryRenderer } from './contexts/renderer.svelte';
import { emitCode } from './emit-code.js';

export default function StoryRenderer($$anchor, $$props) {
	$.push($$props, true);

	const context = useStoryRenderer();

	$.user_effect(() => {
		context.set({
			currentStoryExportName: $$props.exportName,
			args: $$props.args,
			storyContext: $$props.storyContext,
			metaRenderSnippet: $$props.metaRenderSnippet
		});
	});

	$.user_effect(() => {
		// TODO: optimize effect params here, we don't read the whole context in reality
		emitCode({ args: $$props.args, storyContext: $$props.storyContext });
	});

	var fragment = $.comment();
	var node = $.first_child(fragment);

	$.component(node, () => $$props.Stories, ($$anchor, Stories_1) => {
		Stories_1($$anchor, {});
	});

	$.append($$anchor, fragment);
